import React from 'react';

const TextField = ({
  input, meta: { touched, error }, isError,isEmailCorrect,isPasswordCorrect, ...restOfInput
}) => (
  <div>
  <input
    {...input}

    {...restOfInput}
  />
  {touched && error  && <span>{error}</span>}
  (!{isEmailCorrect} && <span>email wrong</span>) 
  </div>
)

export default TextField
